 ????:\\n\\nMany... MANY DAYS! yes.... yes..... I know the maze! I sleep the maze..... I....\\n\\nhaha..........hahaha! I am one ......... maze! \\nMINE!\\n\\n*the rest is too scribbled and fallen apart to read*',},['Alpha']=1,['SizeX']=26.456456,['Id']=1266,['Groups']=0,['X']=82240.113828,['Z']=91849.030858,['Roll']=0,['Color']=102439,['Contrast']=1,},[34]={['EffectType']=8502,['SizeZ']=30,['Y']=37165,['Pitch']=0,['SizeY']=30,['Yaw']=5.061455,['MetaData']={['title']='Tattered note book',['message']='Day ????\\n\\nThe tunnels...... they kept coming.....\\nI sealed most of them now, but I still need a way to keep them out of my hide away....\\n\\nDay ????\\n\\nLast night..... did farther speak to me? I dreamed the words... the door....\\nis this the answer to keeping those.... those..... things..... outside?\\nI will start to carve it immediatly.\\n\\nDay ????\\n\\nmany hours were spent but I think I did the best I can....\\nUpon placing the slab in place it glowed a black aura.\\nThank goodness I am being watched over in this realm\\n\\nDay ????\\n\\nIt keeps the locals away quite well. Those who dont run are dealt with by the door its self.\\n\\nI pray I wont have to stay here much longer, but I can only assume I have been forgotten now. \\nThere is so much more I could have done.... \\n\\nI never got a chance to properly look within the dominion sanctuary....\\n\\nI never got the chance to present my interests and apply for the position of....\\n\\n*the rest is too faded to read*',},['Alpha']=1,['SizeX']=26.456456,['Id']=1267,['Groups']=0,['X']=85134.118516,['Z']=91705.473815,['Roll']=0,['Color']=102439,['Contrast']=1,},},}"
