7,['Pitch']=0,['Color']=999999,['SizeY']=62,['Alpha']=0.660000,['Id']=1233,['SizeX']=62,['SizeZ']=62,['X']=122316,['Roll']=0,['Z']=99502,['Groups']=0,['Contrast']=2,},[113]={['Yaw']=0.338594,['EffectType']=1008,['Y']=27131,['Pitch']=0,['Color']=999999,['SizeY']=62,['Alpha']=0.660000,['Id']=1234,['SizeX']=62,['SizeZ']=62,['X']=122417,['Roll']=0,['Z']=99801,['Groups']=0,['Contrast']=2,},[114]={['Yaw']=6.063274,['EffectType']=7,['Y']=30732,['Pitch']=1.492257,['Color']=179954,['SizeY']=80,['Alpha']=1,['Id']=1235,['SizeX']=88,['SizeZ']=80,['X']=122452,['Roll']=3.101450,['Z']=99973,['Groups']=0,['Contrast']=1,},[115]={['Yaw']=4.946263,['EffectType']=8503,['Y']=30736,['Pitch']=4.726352,['Color']=49917,['SizeY']=60,['Id']=1236,['Alpha']=0,['SizeX']=47.456456,['Roll']=3.152065,['SizeZ']=60,['X']=122453,['Z']=99971,['MetaData']={['title']='Blut Magie für Dummies',['message']='\\n\"Blutmagie\" verindet man mit allen Arten von dunklen Bildern, nicht wahr? Das Wort \"Blut\" ist ein echter Blickfang. Kombinieren Sie es mit Worten wie \"Magie\", \"Ritual\", \"Zauber\" oder \"Ritus\". Das erste, was Ihnen in den Sinn kommt, sind Menschenopfer auf einem blutrieffenden Steinaltar, Bilder die aussehen, wie direkt aus einem Horrorfilm.\\n\\nWie immer ist die Fiktion viel dunkler und bewegender als die Realit��t. Ja, Blut kann gefährlich sein - sowohl magisch als auch weltlich. Feuer kann aber auch gefährlich sein, und dennoch würde niemand daran denken, Ihnen zu sagen, dass Sie es nicht zum Kochen Ihrer Mahlzeiten verwenden sollen. Sie müssen nur lernen, wie man es sicher und richtig benutzt.\\n\\nDie Wahrheit ist, dass Blutmagie ziemlich mächtig sein kann, wenn Sie dazu begabt sind und wenn Sie wissen, was Sie tun. Sie sollte nicht leichtfertig oder nachlässig ausgeführt werden; aber sie verdient nicht den \"Tabu\" -Stempel, den viele schnell geben.\\n\\nDie Kraft des Blutes\\n\\nIch bin sicher, ich muss dir nicht sagen, dass Blut eine mächtige Sache ist. Dies ist etwas, das so in uns eingebettet ist, dass wir es alle verstehen. Angst und Ehrfurcht vor Blut gehen auf unsere frühesten menschlichen Vorfahren zurück. Der Anblick dieser leuchtend roten Flüssigkeit - ob von einem Feind oder Freund, Ihrer Beute oder von sich selbst - erregte sofort Aufmerksamkeit. Blut ist mit so mächtigen Konzepten verbunden, dass manche Menschen es nicht ertragen können und ohnmächtig werden könnten, wenn ihnen zu viel präsentiert wird. Hämophobie ist die Angst vor Blut.\\n\\nAus \"Hexerei üben: Was Sie über Blutmagie wissen sollten\", MACKENZIE SAGE WRIGHT',},['Contrast']=1,['Groups']=0,},[116]={['Yaw']=5.923647,['EffectType']=8503,['Y']=30736,['Pitch']=4.726352,['Color']=49917,['SizeY']=60,['Id']=1237,['Alpha']=0,['SizeX']=47.456456,['Roll']=3.152065,['SizeZ']=60,['X']=122345,['Z']=99840,['MetaData']={['title']='Blood Magic for Dummies',['message']='\\n\\'Blood magic\\' conjures up all kinds of gothic images, doesn\\'t it? The very word \\'blood\\' is a real attention-grabber. Combine it with words like \\'magic\\', \\'ritual\\', \\'spell\\', or \\'rite\\' and the first thing that comes to mind is human sacrifices on a stone altar dripping with dark red and other images that look like something straight out of a horror movie.\\n\\nAs usual, the fiction is much darker and more stirring than the reality of it. Yes, blood can be dangerous- both magically and mundanely. But fire can also be dangerous, and yet no one would think to tell you not to use it to cook your meals. You just have to learn how to use it safely and properly.\\n\\nThe truth is that blood magic can be quite potent if you\\'re inclined to do it, and if you know what you\\'re doing. It should not be undertaken lightly, or carelessly; but it doesn\\'t deserve the \\'taboo\\' stamp that many are quick to give it.\\n\\n\\nThe Power of Blood\\n\\nI\\'m sure I don\\'t need to tell you that blood is a powerful thing. This is something that is so embedded in us that we all understand it. Fear and awe of blood goes way back to our earliest human ancestors. The sight of that bright red fluid-whether it was coming from an enemy or friend, your prey or yourself-got immediate attention. Blood is associated with such powerful concepts that some people can\\'t stand the sight of it, and might faint away if presented with too much. Hemophobia is the fear of blood.\\n\\nBlood is associated with death: the slain warriors on the field, the victim of violence, the hunter\\'s prey all lay bloody in their final state. Blood is also associated with life: it\\'s part of the cycle of fertility that perpetuates life. \\n\\nFrom \"Practicing Witchcraft: What You Should Know About Blood Magic\", MACKENZIE SAGE WRIGHT',},['Contrast']=1,['Groups']=1,},[117]={['Yaw']=0.757473,['EffectType']=7,['Y']=30732,['Pitch']=1.492257,['Color']=179954,['SizeY']=80,['Alpha']=1,['Id']=1238,['SizeX']=88,['SizeZ']=80,['X']=122344,['Roll']=3.101450,['Z']=99842,['Groups']=1,['Contrast']=1,},[118]={['Yaw']=0.338594,['EffectType']=1008,['Y']=27651,['Pitch']=0,['Color']=999999,['SizeY']=142,['Alpha']=0.660000,['Id']=1239,['SizeX']=162,['SizeZ']=142,['X']=121315,['Roll']=0,['Z']=101025,['Groups']=0,['Contrast']=2,},[119]={['Yaw']=3.541273,['EffectType']=4405,['Y']=19885,['Pitch']=0,['Color']=999999,['SizeY']=26,['Id']=1470,['Alpha']=0.400000,['SizeX']=172,['Roll']=0,['SizeZ']=26,['X']=106558,['Z']=106418,['MetaData']={['message']='A N T E  P O R T A S',},['Contrast']=1,['Groups']=0,},[120]={['Yaw']=3.546509,['EffectType']=4542,['Y']=19652,['Pitch']=0,['Color']=999999,['SizeY']=600,['Alpha']=1,['Id']=1471,['SizeX']=600,['SizeZ']=600,['X']=106596,['Roll']=0,['Z']=106471,['Groups']=0,['Contrast']=1,},},['Version']=1759,['TS']=1629843446,}"
