R["fx__@vargadis"]="{['Houses']={[1]={['Effects']={},['Version']='15.8.1',['World']='eu',['TS']=1604667832,['HouseId']=49,},[2]={['Effects']={},['Version']='16.0.9',['World']='eu',['TS']=1610724605,['HouseId']=80,},[3]={['Effects']={[1]={['Color']=102439,['Z']=73712,['Groups']=0,['Yaw']=4.091052,['MetaData']={['message']='That damned, son of a mutt, Reid Hixon, he threw me into the fire in hopes of watching me burn. I have a high belief that someone from the Braithwaite Family tipped him off about my location. I am severely burned, but very much alive. I can only wait in this basement for the fire to settle enough to crawl back to the surface.\\n\\nI got a glimpse of my nephew Lemuel\\'s face, that poor boy, forced by the Revenue Agents to watch me, his aunt, burn alive. What cruel fate awaits him now.\\n\\nReid Hixon, I spit his name. He will pay dearly for what he has caused. I need to contact JB Cripps somehow, let him know what happened here today, ask that he and Marcel, rescues Lemuel and bring him back safely. This is the work for outlaws such as him.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nThe Journal, after this point, is damaged and only a few words can be seen and read, you make out the words of a new rescued outlaw from Sisika Penitentiary under the care of Jessica LeClerk and the shoot-out in Blackwater. You can also read something about this journal escaping the fires once again. The rest of the pages is empty.',['title']='Maggie Fike, Bayou Nwa, 1892',},['Roll']=0,['SizeY']=30,['Y']=7719,['Alpha']=1,['SizeX']=26.456456,['SizeZ']=30,['Pitch']=4.754277,['X']=67418,['Id']=1001,['EffectType']=8501,['Contrast']=1,},},['Version']='16.0.9',['World']='eu',['TS']=1611233664,['HouseId']=18,},[4]={['Effects']={[1]={['Color']=995630,['Z']=59560,['Groups']=0,['Yaw']=2.158972,['MetaData']={['message']='D. Vintersaga, First Seed, 2E 582\\n\\nIt gnaws your brain and grinds your teeth, you want to run away. You ask yourself if this is true and if it\\'s safe to stay. You turn around and wipe away a slowly falling tear. It hurts your heart to know the truth, the change is what you fear.\\n\\nSome nights you can\\'t remember; feet wet and dark with mud. The tearing in your clothing, the white dress stained with blood. The fevered kiss, was oh so sweet but also filled with sin. The love that burned from days gone by is dying deep within.\\n\\nYou look up and there it is, a flicker in your eye. Accept your fate, and fear it still, and truly so did I. You gasp for air, the pain arise the end is here to soon. You had it all, now let it go, there\\'s nothing but the moon.\\n\\nSister moon tonight is full, she calls you to her side. It\\'s time for you to let things loose, there\\'s nothing left to hide. Let it out, that everything to become this something new. A hunting rage with fangs and claws, the beast tonight is you.',['title']='Nothing but the Moon',},['Roll']=0,['SizeY']=30,['Y']=14455,['Alpha']=1,['SizeZ']=30,['SizeX']=22,['Pitch']=4.722861,['X']=36258,['Id']=1001,['EffectType']=8502,['Contrast']=2.960000,},},['Version']='16.3.2',['World']='eu',['HouseId']=61,['TS']=1615493877,},},['TS']=1615493877,['Key']='fx__@vargadis',}"
